import requests, json

BASE = "http://192.168.210.102:1234"
payload = {
    "model": "qwen2.5-vl-7b-instruct",
    "messages": [
        {"role": "user", "content": [
            {"type":"text", "text":"Na imagem existe um magazine com 6 peças, essas peças podem ser vermelhas, azuis ou pretas e estão dentro de cada circulo verde. Quantas peças de cada cor existem na imagem? Verifique que os tons podem sofrer variações com base na iluminação, portanto siga o que mais se aproxima das 3 cores informadas. Me diga também a posição de cada peça."},
            {"type":"image_url", "image_url":{"url":"data:image/png;base64,"}}
            ]
        }
],
    "stream": True,
    "temperature": 0.4,
    "max_tokens": 512
}

with requests.post(f"{BASE}/v1/chat/completions",
                   headers={"Content-Type": "application/json"},
                   data=json.dumps(payload),
                   stream=True,
                   timeout=60) as r:
    r.raise_for_status()
    for line in r.iter_lines():
        if not line:
            continue
        if line.startswith(b"data: "):
            chunk = line[6:]
            if chunk == b"[DONE]":
                break
            msg = json.loads(chunk.decode("utf-8"))
            delta = msg["choices"][0].get("delta", {}).get("content", "")
            if delta:
                print(delta, end="", flush=True)
